import React from 'react'
import Semaforo from './components/semaforo/Semaforo'
import Carros from './components/carros/Carros'
import Carteirinha from './components/carteirinha/Carteirinha'


const App = () => {

  const listaCarros = ["Monza", "Fusca", "Kombi", "Gurgel", "Hobby", "Brasilia", "Ford Ka", "Comodoro", "Opala", "Diplomata"];
  const todosCarros = listaCarros.map(
    (c, i) =>
      <li key={i}>{i + 1} - {c}</li>);

  return (
    <>
      <div>
        <Semaforo />

        <Carros lista={listaCarros}>
          <li>{todosCarros}</li>
        </Carros>

      <Carteirinha />
      </div> 
    </>
  );
}
export default App;
